(1526, '[Pangdabei] スウェット 上下 セットアップキッズ', 34994, 33, '2023-12-22 13:48:14', 1, 0, 'セット内容】：上着、ズボン\r\n柔らかくて、肌触りが気持ちいいです。可愛いデザインは子供をいっぱい活気に見せています。\r\n上下別にもお使いいただける便利なセットです！女の子のかわいいジャージ上下セット!!カッコよく着こなせます!!カジュアルなデザインでスクールからジムの行き帰り、日常使いまでも幅広く使える。\r\n薄すぎず厚すぎず、絶妙な厚さでコーディネイトの幅も広がります。運動会、ジム、ジョギング、トレリーング、マリンスポーツなど様々な場面で活用できるスポーツウェア（運動着）です。お部屋着、ルームウェアとしてもお勧めです。\r\n通園、通学、部活や、学校行事の林間学校、修学旅行、研修宿泊のセットアップ、運動会のジャージ、ダンスの練習着や普段着、部屋着、ルームウェアなどさまざまなスポーツや日常生活にも重宝するパーカー セットアップです。', 1),
(1527, '[Baby nest] カバーオール ロンパース', 31322, 43, '2023-12-22 13:52:24', 1, 0, '着心地よい‐柔らかく肌当たりが良い95%コットンを使って、吸湿性や通気性が良いベビー服です。5%ポリエステル繊維を使用し、横方向に伸びるので赤ちゃんが動きやすいカバーオールです。高品質の素材を使用し、敏感肌のベビーにも優しくおすすめです。\r\n暖かい‐2層構造だから、間に空気を含むので保温性があり、あたたかい赤ちゃん服です。それに、通気性・吸湿性・吸水性に優れて、お出かけなどいろいろなシーンで活躍してくれる子供服です。肌が弱い子や寝汗が多い子におすすめ◎。\r\nデザイン‐ポロシャツとサロペットを合わせたようなデザインで、ボーダー＆ニュアンスカラーでおしゃれ見えるベビー服です。この1枚でコーディネートが完成し、通園通学などシーンにぴったりです。胸元にクマの刺繡がポイントです。\r\n前開きタイプ‐外出服の前側はスナップボタンで全開するので、うつぶせ寝もしやすく、寝たまま着替えられます。股下が全開にできるのでお着替えもおむつ替えもラクです。袖口と裾口がリブ仕様になっており、肌寒い秋口から冬の時期に寒さから赤ちゃんを守ります。\r\nプレゼント‐お部屋での着用はもちろん、ちょっとした外出にも◎。旅行や入園式、帰省、お誕生日などのおめかしスタイルにおすすめです。フォーマル、結婚式、演奏会、発表会、ピアノ発表会、卒園式、フラワーガールなど特別なシーンにもおすすめです。', 1),
(1528, '男の子フォーマルスーツ キッズ', 43422, 58, '2023-12-22 13:58:48', 1, 0, '【着心地らくらく】このスーツはポリエステルと綿素材を使用し、柔らかくて子供の皮膚に優しい、通気性と速乾性にも優れています。吸水性・耐久性に優れた素材を使用した。パンツ裤衩（ズボン裤子）のウエストはゴム入りなので着脱のしやすさもポイントです。\r\n【デザイン】子供用フォーマルスーツ、おしゃれで人気なチェック柄スーツはフォーマルな場合だけでなくて普通着としても使えます。素敵でかっこいいボーイズにぴったりのフォーマルスーツで ,お子様も大満足して頂きます。動きやすく、シーズンを問わずお使いいただけます。\r\n【適用場合】七五三、卒業式、入園式、入学式、結婚式、撮影記念、発表会、コンサート、パーティー、子供の日にプレゼントにも最適です。\r\n【スーツセット内容】ベスト*1、ジャケット*1、ズボン*1、蝶ネクタイ*1（蝶ネクタイは贈り物）。（モデル着用のシャツは含まれません）ご注意：購入前には弊社のサイズチャートを参照してください。', 1),
