(1530, '[Reegoo Peter] ベビー服 長袖 ロンパース カバーオール', 19020, 107, '2023-12-22 14:05:47', 1, 0, '襟付き、サロペット風、女の子の可愛さをアップ\r\nご出産準備やお祝いのギフトにもおすすめです,お部屋着やお誕生日・結婚式・記念日・出産祝い・お祝いギフトなどにぴったりちクリスマスや新年プレゼントも完璧。\r\nスナップボタンの前開きで、両足とも一番下まで開くのでお着替えやオムツ交換が楽ちん\r\n66cm 3-6ヶ月、73cm 6-9ヶ月、80cm 9-12ヶ月、90cm 12-24ヶ月、赤ちゃんの成長はとても速いので、ビッタリよりも少し大きめのサイズがオススメ', 1),
(1531, '[Baby Nest] ベビー服 ロンパース 半袖', 42081, 35, '2023-12-22 14:08:23', 0, 0, '★高品質の素材★　直接肌にふれるものだから、やさしさにこだわりたい。［Baby nest］ベビー服は良質な綿の素材を厳選し、ふんわりやわらかタッチのロンパースに仕上げました。柔らかなフライス素材でベビーの肌にも優しいです。\r\n★総柄プリント★　かわいい柄で女の子におすすめの半袖のカバーオールです。袖口もゴムシャーリングで女の子らしく仕上げています。胸元の可愛いリボン、足口のギャザーなど、ディテールまで女の子らしさ満点のショートオールです。\r\n★着せ替え便利★　肩開きのタイプでお着換えがラクラクです。股下はスナップボタン留めでおむつ替えもスムーズです。おしりのマチを大きくとり、おむつベビーが動きやすいです。\r\n★インナーやアウター★　真夏も涼しいベビー服を探しているママにおすすめです。ショートオールは、夏に一枚で使えるのはもちろん、肌着としても一年中使え、実はとっても優秀です。一枚で着用できるのはもちろん、上にトップスを重ねて、多いシーズン大活躍します。\r\n★プレゼント★　自用はもちろん、出産祝いやお誕生日のプレゼントもおすすめです。七五三、結婚式や入園式などのイベントや、お食い初め、お宮参りなどの記念撮影にピッタリのベビー服！', 1),
(1532, '[WUOWU] ワンピース', 46804, 88, '2023-12-22 14:10:37', 0, 0, '♪【プロ設計】—— 配色にこだわり、かわいらしさと上品さを兼ね備えたスーツです。シンプルで高級感が溢れる女の子 ワンピース キッズ 子供服 フォーマルワンピース。フォーマルでもいけるシンプルワンピース。\r\n♪【4点セット内容】—— ジャケット・ワンピース（ノースリーブ）・帽子・ハイソックス\r\n♪【全季節大活躍】—— いまの季節に大活躍間違いなしの、とっても魅力的な一着です。ちょうどいいの生地でこれからのシーズンにぴったりの一枚です。普段使いにヘビロテしたくなるアイテム。可愛らしさ満載の女の子 ワンピース。\r\n♪【適用場所】—— 可愛い 通学 入園式、入学式、通園、卒業式、七五三、結婚式、お受験、発表会など長いシーズン、様々なシーンでご活用いただける1着です。\r\n♪【購買保障】—— 60日間 返品 返金 保障 付きです。弊店のアフターサービスはよいですので、購買の保障もありますので、ご商品を安心購入してください。お楽しみにショッピングを祈ります。', 1),
(1533, '[YINFOON] 長袖 ロンパース', 22690, 89, '2023-12-22 14:12:55', 0, 0, '【綿素材】汗をしっかりと吸収し、洗濯しても傷みにくく型崩れしにくい丈夫な素材です。柔らかくて赤ちゃんの肌に優しい\r\n【前開きスナップ】スナップボタン式、隙間なし、しっかり留めています。お着替えやおむつ替えがラクラク\r\n【季節】生地は厚すぎず薄すぎずで、春秋季節の変わり目にオススメ！冬場はパジャマやインナーとしても大活躍しております\r\n【恐竜柄】可愛い恐竜プリント柄、赤ちゃんの可愛さを引き立てる、出産祝いの贈り物にも喜ばれます\r\n【サイズ】：59cm 推奨身長：59-66cm 推奨月齢：0-3ヶ月。赤ちゃんの成長はとても速いので、ビッタリよりも少し大きめのサイズがオススメ?\r\n', 1),
(1534, '[Reegoo Peter] ワンピース', 22883, 47, '2023-12-22 14:14:34', 1, 0, 'かわいいデザイン‐カーキのは胸元のフリル＆プチリボンでガーリーに、ブルーのはポケット＆リボンが何とか可愛いです。女の子の可愛さを引き出します。\r\n着替え便利‐後ろのスナップを開けて着替えもスムーズにできます。胸下の切り替えからふんわり広がるガーリーシルエットで、ベビーの動きがより一層可愛く見えます。\r\nナチュラルなカラーが優しい雰囲気のサロペットパンツ。ゆるっとカジュアルなデザインながら、おしゃれな雰囲気が満載。デイリーユースはもちろん、大切な日のお出掛け用にもおすすめのグッドデザインです。\r\n色んな場合‐花火大会や出産祝いやお誕生日のプレゼントとしてもおすすめです。お出かけやルームウエアにも大丈夫です。赤ちゃんの成長はとても速いので、ビッタリよりも少し大きめのサイズがオススメ。', 1),
(1535, '[ミキハウス] カバーオール ロンパース 長袖', 35025, 41, '2023-12-22 14:16:58', 0, 0, '\n大きめの ロゴ ネームがキャッチ―な ミキハウス カバーオール ・ ミキハウス 長袖 ロンパース です。 シンプル なバイカラーのデザインがポイントです。接結カノコ天竺で通気性が良いため、汗をかいても着心地よく、リブが付いて 秋 口から 春 先まで暖かく着られます。股下はホックボタンで全開するので、オムツ替えやお着替えもしやすいです。環境と人権に配慮した、 サステナブル 素材を使用している mikihouse カバーオール ・ mikihouse ロンパース です。', 1),
(1536, '[ミキハウス] ツーウェイオール カバーオール ロンパース', 44961, 99, '2023-12-22 14:29:58', 0, 0, '☆ シンプル なデザインの ミキハウス ツーウェイオール です。胸元 レース の どうぶつ 刺繍が上品で可愛いデザインです。素材はやわらかな通年素材で、産まれてから 3ケ月 くらいまで着用できる 出産準備 の必需品です。最初は ドレス タイプとして、足をバタバタ動かすようになってきたらホックの付け替えで カバーオール 仕様にできる mikihouse ツーウェイオール です。 ミキハウス ベビーウェア は、 出産準備 や 出産祝い や プレゼント に人気のアイテムで、ご 退院 などの 記念日 や お披露目シーンにもおすすめです。', 1),
(1537, '[Fairy Baby] ベビー ロンパース 冬 ジャンプスーツ', 38249, 39, '2023-12-22 14:32:56', 2, 0, '「高品質な素材」防風性のある表地で作られたベビーロンパース、雨や雪の天候にも対応できます。ふかふかした感触が心地よい起毛裏地、赤ちゃんの繊細な肌をやさしく守りながら、快適な履き心地を提供します。綿入れ、三層保温防風、縫製もしっかりで丁寧で、冬の寒さからベビーをしっかり保護する冬ロンパースです。\r\n「防寒性よい」寒い季節に大活躍するベビー服ジャンプスーツです。三重防寒、冬の寒さからお子さまを全方面に保護します。可愛いフード付きのデザイン、頭もしっかりガードして、寒さから弱い赤ちゃんを守って、寒い冬に適用する厚手カバーオールです。袖口と足口はリブ仕様で、暖かさを逃しません。\r\n「可愛いデザイン」クラシックのデザイン、無地で、とても相性がいい赤ちゃんロンパースです。フードには可愛いクマ耳が付いています。可愛さと機能性を兼ね備え、男女問わず使える可愛くておしゃれなベビージャンプスーツです。\r\n「着せ替え便利」着脱しやすいデザインのベビー長袖ロンパースです。股ぐらまで下がるフロントファスナーと股下のスナップボタンで、着脱はしやすいし、短時間で着用でき、赤ちゃんが着替え中に風邪を引かないようにして、オムツの着替えも便利です。\r\n「おすすめ場合」お子様の誕生日・記念日・出産祝いなど、プレゼントに喜ばれているアイテムです。普段の秋冬のお出かけに大活躍間違いなしです。部屋着、旅行、通園、お出かけなど色々なシーンで活躍してくれるベビーロンパース！', 1),
(1538, 'ベビースワドル毛布-かわいいパンダ幼児服', 23410, 41, '2023-12-22 14:36:04', 2, 0, '【サイズとデザイン】： 当社のスワドルブランケットは、体重7～18ポンド、身長20～26インチの赤ちゃんに適しています。かわいいクマのパーカーは、調節可能なフック＆ループファスナーで、腕を入れたり出したりして赤ちゃんを固定することができます。スワドルブランケットで赤ちゃんに快適さと安心感を与えましょう。\r\n【多用途】: ユニセックスのスワドルは、完璧なベビーシャワーの贈り物になり、ベビーカー用ブランケットとして、保育園で、ベビー服として、寝袋、ベビーカー用キルト、ベビーベッドラップとして、または多目的ブランケットや幼児用スリーピングサックとして使用できます。\r\n【カラー・オプション】： かわいい4色の中から、あなたのスタイルと好みにぴったりのスワドルブランケットをお選びください。\r\n【満足保証】： 当社のスワドルブランケットを気に入っていただけると確信しています。何か問題が発生した場合は、まず弊社にご連絡ください。', 1),
(1539, '[SLINX] ベビー服 袴 ロンパース', 28756, 93, '2023-12-22 14:41:36', 1, 0, 'こだわりいっぱい！可愛すぎるベビー袴。お子様の大切な記念日に、とっておきの和装フォーマルでお祝いしませんか？\r\n生地は、優しい肌触りに優れた吸水性が特徴の綿95％を使用。お子様の汗をさっと吸収してくれます。\r\n赤ちゃんに着せるだけでとっても可愛い和装姿に大変身！お食い初め、お宮参り、お正月、初節句、お祭りなどお子様の特別な日の写真撮影にぴったりのアイテムです。\r\nおしゃれでかわいい袴風セットアップ。上下が分かれているので脱ぎ着しやすく、お子様を寝かせる必要もなくお洋服と同じように着替えができます。\r\n他にはない洗練されたデザインは、お正月や初節句、結婚式などお祝いの席にぴったり。ご自宅用にはもちろん、プレゼントにもおすすめ！ 大切な記念日の衣装などにも重宝するので、出産祝い、ハーフバースデー、孫の日などの贈り物にいかがでしょうか。また、初節句祝いのギフトにもおすすめです。', 1),
(1540, '[KISBINI] 長袖 Tシャツ カットソー パーカー', 3310, 85, '2023-12-22 15:07:42', 0, 0, 'シーン：普段着、スポーツ、ルームウェア、外泊、通園通学、旅行、出産祝い、誕生日プレゼント\r\n光るサメ柄、恐竜柄と収納できるバッグ付きのパーカーは、キャラクターでカッコイイです。\r\nどんなスタイルにも合わせやすく。お子様のお誕生日プレゼントとしてもおすすめです。\r\nデイリーユースとしても、部屋着としてもお出かけでもスポーツでも通用できるスウェットトレーナーは、一枚は持っていたいカジュアルウェアの大定番。', 1),
(1541, '[JINPIN] 子供服 セットアップ デニム ジャケット&ショートパンツ', 41707, 41, '2023-12-22 15:09:44', 1, 0, 'ゆったり着心地でトレンドスタイルをラクに楽しめる１点。上品はデザインと丁寧な縫製に合わせて、一瞬ですごく甘いキッズに変身します、超可愛い。韓国風スタイルで、ファッション性が高いスポーツウェア子供服。\r\n落ち着いた配色にこだわり、かわいらしさと上品さを兼ね備えたフォーマルウェアに仕上がっています。おしゃれエレガントで上品な雰囲気のある女の子カジュアルウェアです。やわらかな素材なので、着やすく脱ぎやすいお洋服です。\r\nデニムコート+半パンツ。大人顔負けなデニムシャツとデニム短パンの可愛いセットです。セットとしてはもちろん、別々に使いとしても可能です。伸縮性がある素材を採用した可愛いｔシャツは弾力があり、 変形しにくく、体とフィットして快適、 体にフィットしますので、着痩せ効果抜群。\r\nスポーティな要素を取り入れた、おしゃれなデザインで、デニム素材の半袖ジャケットとデニムショートパンツのジャージ上下セットが登場しました。簡単に着脱できる伸縮性のあるウエストにより、ベビー服が快適に動くようにします。\r\n普段着、お出かけ、通園通学、旅行、リゾート、遊園地、部屋着、ルームウェア、スポーツ服、運動会、ビーチウェア、また入学式、卒園式、発表会、パーティー、フォーマルなどどんな場合でも似合う。簡単でお洒落なデザインはお目立つに見えます。可愛いデザイン、きちんと感もあってどんな場合にも使える人気セットアップです。', 1),
