(1570, 'Krooley-Ne-J Jjj', 10259, 52, '2023-12-26 14:11:11', 0, 0, '万能シルエット×ゴムウエストの穿き心地抜群なデニムパンツ「KROOLEY-NE-J JJJ」\r\n人気のKROOLEYモデルのJOGG JEANS\r\nJOGG JEANSは裏地がスウェット織で作られているため、スウェットを穿いているようなリラックスできる着心地が特徴です\r\nレギュラーフィット・ミドルウエスト・テーパードシルエットなので、サイズのチョイス次第でスリムにも穿ける万能デニム\r\nドローコード付きのウエストゴムタイプはベルトがなくても安心\r\nデイリーユースにぴったりなデニムパンツです', 1),
