(1572, 'Krooley J Joggjeans', 15363, 82, '2023-12-26 14:12:45', 0, 0, '「KROOLEY-NE-J JJJ」　人気のKROOLEYモデルのJOGG JEANS\r\nJOGG JEANSは裏地がスウェット織で作られているため、まるでスウェットを穿いているようなリラックスできる穿き心地です\r\nレギュラーフィットタイプでミドルウエスト、テーパードシルエット\r\nサイズのチョイス次第でスリムにも穿ける万能デニムです\r\nウエストゴムタイプ\r\nベルトループのほかにドローコードがついているので、ベルトがなくても安心です\r\nサイズのアップダウンで、様々な体格のキッズにマッチしやすい1本です', 1),
(1573, 'Criss', 22658, 74, '2023-12-26 14:15:11', 0, 0, 'DIESELロゴがフロントに大きくプリントされた存在感抜群のシャツ\r\nオーガニックコットンのダブルツイル糸を使用することで強度と耐久性を高めるとともに、立体感のある表情に仕上がっています\r\nブラックロゴ・レッドロゴの2色展開でどちらのカラーも魅力的\r\nブラックパンツをチョイスするとモードな雰囲気に\r\nデニムパンツとの相性も抜群です', 1),
