(1585, '1979 Sleenker-J', 36088, 60, '2023-12-29 10:09:31', 0, 0, '「1979 SLEENKER-J」 ヨーロッパで初めて開催されたパンクコンサートにちなんで名付けられた、パンクロックにインスパイアされたモデル\r\nスキニーフィットタイプでローウエスト、スキニーレッグ\r\n抜群の伸縮性とホールド感を実現し、美しいシルエットを演出します\r\nウエストがアジャスターで調整可能なところも、キッズラインならではの嬉しいポイント\r\nコットン・ポリウレタンで構成されています\r\nポリウレタンの一種であるElastane Spandexが使用されているので伸縮性が抜群で、柔らかい肌触りが特徴です\r\nお家でのお手入れが可能です\r\nシルエット、穿き心地ともに申し分ないスキニーデニム\r\nデイリーユースはもちろん、セレモニースタイルにもおすすめの１本\r\nジャケットとシャツをチョイスするとドレッシーなスタイリングが完成します', 1),
(1586, 'Twasher Over', 15566, 64, '2023-12-29 10:12:07', 0, 0, 'インパクト抜群なオールオーバープリント×ロゴTシャツ\r\n総柄ファブリックに、DIESELロゴがレイアウトされたアーティスティックなデザイン\r\n異なるカラーファブリックをアシンメトリーで仕上げた遊びゴコロ抜群の１着\r\nホワイトデニムやブラックデニムとの相性も抜群です', 1),
