(1592, '[CQR] シャツ 長袖 キッズ', 42844, 93, '2023-12-29 11:22:30', 2, 0, '動きが激しい子供にぴったりのキッズ用フランネルシャツ\r\n子供の可愛いらしさを一層アップさせる胸ポケット付き\r\nプラッド柄のデザインで、セーターやブレザーとの相性も抜群。', 1),
(1593, 'Tangie', 42539, 95, '2023-12-29 11:39:00', 0, 0, 'ミニマルなキャップ スリーブが特徴のこの Mini Me スタイルは、オーバル D ロゴのカットアウト バージョンで装飾されています。同系色の糸で丁寧に刺繍された仕上げに注目してください。', 1),
(1594, 'Tbiggor-Ne-Over Jjj', 23357, 102, '2023-12-29 11:41:17', 0, 0, 'ジョグファブリックの半袖Tシャツ\r\nブランドアイデンティティ溢れるモノグラムオールオーバープリントが存在感抜群なTシャツ\r\nJOGG JEANSファブリックのため柔らかく、リラックスした着用感が特徴的\r\nブラックベースなので主張し過ぎず、お持ちのお洋服とのスタイリングにも馴染みが良いアイテムです\r\nロングスリーブアイテムとのレイヤードスタイルもおすすめ\r\nユニセックスで着用可能です', 1),
(1595, 'Twain', 8171, 80, '2023-12-29 11:42:10', 0, 0, 'スモーキーカラーベースのカモフラ柄半袖トップス\r\nコンパクトなシルエットで程よく身体に沿う、ガーリーな１枚です\r\nネックカラーやコントラストカラーを使ったアウトシームのディテールや袖や裾のメロウディテールがポイント\r\nボトムを選ばないので、幅広いジャンルのスタイリングにマッチします\r\nフレアパンツやハイウエストアイテムとのスタイリッシュな着こなしがおすすめです', 1),
(1596, 'T-Hilary-L1', 13101, 55, '2023-12-29 11:45:16', 3, 0, '存在感のある一枚は、ロングシーズン通してデイリーに大活躍\r\nいつものデニムスタイルを華やかにブラッシュアップしてくれるマストハブアイテムです', 1),
(1597, 'T-Sli-Ovalace', 46704, 91, '2023-12-29 11:48:24', 0, 0, 'ストレッチコットンジャージー素材が肌触りの良いスリムフィットTシャツ\r\nレースの異素材使いがアクセントになった一枚は同系色のレースを使用しているため上品でエレガントな印象に\r\nフロントのオーバルⅮロゴもアクセントに\r\n女性らしいミニマムなシルエットがカジュアルなデニムスタイルをリッチで大人なスタイルに仕上げてくれます\r\n一枚で存在感を放つトップスは、カーディガンやシャツのインナーとしてロングシーズンお使いいただけます', 1),
(1598, 'T-Boxt-Japan-Yy', 26854, 48, '2023-12-29 11:59:54', 0, 0, 'DIESEL × YUKINO YAMANAKA 「POSE」展の開催を記念して、ディーゼルと山中雪乃のコラボレーション によるアイテムが登場', 1),
