(1600, 'J-Martex', 46325, 69, '2023-12-29 12:02:23', 0, 0, '濃淡のあるアンニュイな色味がデザインポイントのジャケット\r\n色褪せ効果のある箇所は、部分的にブリーチスプレーを用いて手作業で仕上げられています\r\nセンターを走るジッパープラーにタイニーロゴを採用し、さりげなくもディーゼルらしさが宿るアクセントに\r\nビスコース混サテン素材ならではの美しい光沢ととろみのある風合いも特徴的です\r\n裏地付き', 1),
(1601, 'P-Marty', 12695, 73, '2023-12-29 12:06:22', 0, 0, '濃淡のあるニュアンスカラーが特徴的なルーズフィットのパンツ\r\n色褪せ効果のある箇所は、部分的にブリーチスプレーを用いて手作業で仕上げられています\r\n適度なボリュームとサテン特有のとろみ・落ち感が相まった立体的なシルエットも◎\r\nフロントフライはジッパー仕様、ウエストバンドには伸縮性がありドローストリングが付いています\r\nバックポケットの右側にボディと同系色のDロゴ付きです', 1),
(1602, 'K-Osbert', 29990, 106, '2023-12-29 12:09:52', 0, 0, '前回のファッションショーからインスピレーションを得た、ダブルレイヤーのピールオフディテールが主役のニット\r\nローゲージニットにジャージー素材を重ねた一枚は、ジャージー部分にピールオフ処理を加え、無造作でワイルドな佇まいに仕上げています\r\n袖口や裾はカットオフ風のラフな表情に\r\nサンブリーチ効果で色斑があるのも特徴のひとつです\r\n', 1),
(1603, 'K-Darin', 4207, 49, '2023-12-29 12:10:26', 0, 0, 'ビンテージ感のある洗練されたカラーリングに注目したい長袖ニット\r\n胸元にはカットアウト仕様のメタルのオーバルDロゴを配し、シャープなアクセントになっています\r\n適度にやわらかく、しっかりとしたコットンリブを採用\r\nスリムフィットシルエットのためラフになりすぎず、カジュアルウェアながらクールな着こなしが完成します', 1),
(1604, 'K-Nevil', 30642, 47, '2023-12-29 12:11:30', 0, 0, '目を惹くグラデーションカラーが魅力の長袖ニット\r\n前身頃に浮かぶ大きなオーバルDにも注目したい一枚です\r\nレギュラーフィットながらも、ドロップショルダーで肩まわりにゆとりを持たせており、リラックス感のある着心地に\r\nそのまま着用しても、インナーにシャツなどを組み合わせてレイヤードスタイルにしても楽しむことができるアイテムです', 1),
(1605, 'S-Boxt-Hood-N9', 47361, 34, '2023-12-29 12:13:09', 0, 0, 'ガーメントダイ加工とレーザーホール、マーブルウォッシュを組み合わせ、独特かつハードな印象に仕上げています\r\nフロントにはシグネチャーであるタイニーロゴと、大きなのカンガルーポケットを配置\r\n袖口と裾はストレッチリブ仕様となっています\r\nランダムにほつれたようなデザインなので、下にロンTなどを合わせた着こなしも様になります', 1),
(1606, 'T-Crane-Ls-N2', 31903, 77, '2023-12-29 12:14:04', 0, 0, 'ダメージなどのディテールを落とし込んだ長袖Tシャツ\r\nファッションショーからインスピレーションを得ており、ガーメントダイの生地にレーザーホールやマーブルウォッシュなどの処理を施し、ビンテージライクでインパクトのある佇まいにしています\r\nフロントにはタイニーロゴを添え、ディーゼルを象徴するワンポイントに\r\nやわらかく、しっかりとしたコットンジャージー生地で仕立てています\r\n一枚でモードな着こなしが叶うスタイリッシュなアイテムです', 1),
(1607, 'J-Niel', 6485, 70, '2023-12-29 12:14:45', 0, 0, 'スリーステッチのダイヤモンド型キルティングが魅力的なモックネックのジャケット\r\n若干の中わたが入っており、やわらかくあたたかな一着となっています\r\n表裏のカラーにコントラストがあるのも特徴のひとつ\r\nフロントにジッパーポケット、袖口にジッパーが付いた機能性の高さもうれしいポイントです\r\n左袖にはDパッチをあしらいました\r\nコンパクトなシルエットなので、アウターにインしてもお使いいただけます', 1),
(1608, 'J-Harris', 47355, 94, '2023-12-29 12:15:43', 0, 0, 'ディーゼルのDNAであるデニムとテーラードファブリックを組み合わせたジップアップジャケット\r\nフロントは加工を施したブラックデニム、バックはコットンブレンドの生地を採用しており、前後のギャップが魅力的な一着となっています\r\nタイニーロゴを取り入れたジッパープラーにも注目したいポイント\r\nカジュアルながらもトラッドな雰囲気を併せ持った贅沢なアイテムです\r\n裏地付き\r\n', 1),
(1609, 'J-Devlin', 21467, 112, '2023-12-29 12:16:35', 0, 0, 'テーラードとスポーティのミックスマテリアルが斬新なバイカージャケット\r\nデザインだけを見るとスポーティな印象が強いですが、前身頃にはストレッチウール混のテーラード生地が使われており、トラッドな要素も併せ持っています\r\n中央のジッパープラーはオーバルDロゴを採用し、アイコニックなポイントに\r\nサイドのバンドにサテンのパイピングが施されているなど、細部まで手の込んだ一着となっています\r\n裏地付き\r\n', 1),
(1610, 'P-Devlin', 38094, 81, '2023-12-29 12:17:33', 0, 0, 'テーラードとスポーティのミックスマテリアルが斬新なストレートフィットのパンツ\r\n一見、スポーティテイストに見えがちですが、フロントにはストレッチウール混のテーラード生地を使っていることで、クラシカルな印象も併せ持っています\r\nフロントフライはジッパー仕様になっているほか、ウエストバンドの内側に隠しフック付き\r\nバックポケットがジッパーが付いているのもうれしいポイントです\r\n右後ろにオーバルDのエンブロイダリーロゴがあしらわれています\r\n', 1),
(1611, 'S-Dewny-Double-Check-A', 24544, 71, '2023-12-29 12:18:32', 0, 0, 'ダブルフェイスガーメント＆リバーシブルのオーバーサイズシャツジャケット\r\n片方はチェック、もう片方はライトブルーのデニムになっていて、着回し力の高さが期待できる一着です\r\nややふっくらとしたパッド入りの仕上がりも特徴のひとつ\r\nチェック面には胸ポケットと左襟にエンブロイダリーのオーバルDロゴが施されています\r\n', 1),
(1612, 'J-Micc', 17757, 99, '2023-12-29 12:19:41', 0, 0, 'やわらかくなめらかなタッチのフェイクレザーシリーズから、フード付きジャケットが登場\r\n艶やかな光沢をまとったラグジュアリーな一着です\r\n左袖にあしらわれたオーバルDロゴがさりげないポイント\r\n前身頃にはジッパー付きポケットが備わっています\r\n袖口と裾にドローストリングが付いているので、着こなしにアレンジを加えたい時や防風性をアップさせたい時に活躍します', 1),
(1613, 'K-Gil', 35317, 66, '2023-12-29 12:20:29', 0, 0, 'フロントにカットアウト仕様のエンブロイダリーDロゴがあしらわれたタートルネックの長袖ニット。\r\n編み目が繊細なハイゲージニット＆シンプルな色使いでカジュアルすぎず、きれいめな印象を持ち合わせています。\r\nスリムフィットのため、一枚着でもインナーとしても使いやすく、汎用性の高さが期待できます。\r\n\r\n本製品には、最適な土地管理がなされている農場で、動物福祉に配慮して育てられた羊の毛を用いた認証ウールを使用しています。', 1),
(1614, 'K-Floyd', 44436, 41, '2023-12-29 12:21:17', 0, 0, 'ビンテージロゴがデザインポイントの長袖ニット\r\nロゴはプリントではなくピールオフ処理で立体的に仕上げられており、非常に手の込んだ一枚となっています\r\n袖口や裾にはあえてリブを入れず、ゆるっとした抜け感のある印象に\r\nウールを使用した12ゲージの高密度なニットのため、なめらかさも併せ持っています\r\n', 1),
(1615, 'K-Janci', 41145, 51, '2023-12-29 12:22:01', 0, 0, 'コントラストの効いた大胆な配色が目を惹くニット\r\nタイダイウォッシュ加工で仕上げているので、ナチュラルな濃淡が美しい一枚です\r\nケーブルとリブ編みを組み合わせた立体的な表情や、5ゲージのざっくりとした風合いもポイント\r\nリラクシーなルーズフィットなので、そのままトップスとして着用しても、インナーにシャツを合わせてレイヤードスタイルにしても楽しむことができます', 1),
(1616, 'K-Glare', 11724, 34, '2023-12-29 12:22:59', 0, 0, '胸元にカットアウト仕様のエンブロイダリーDロゴがあしらわれたポロ襟の長袖ニット。\r\n編み目が高密度なハイゲージニットとシンプルな色使いできれいめな印象を持ちつつも、ポロ襟特有のスポーティな要素も併せ持った仕上がりとなっています。\r\nスリムフィットなので、ストレートパンツからワイドパンツまで、さまざまなボトムスとバランス良く合わせることができます。\r\n\r\n本製品には、最適な土地管理がなされている農場で、動物福祉に配慮して育てられた羊の毛を用いた認証ウールを使用しています。', 1),
(1617, 'K-Jonny', 13193, 112, '2023-12-29 12:24:51', 0, 0, 'コントラストの効いた大胆な配色が目を惹くニットカーディガン\r\nタイダイウォッシュ加工で仕上げているので、ナチュラルで美しい濃淡があるのが特徴です\r\nケーブルとリブ編みの立体感と、5ゲージのざっくりとした風合いもポイント\r\nルーズフィットなので、季節の変わり目には軽いアウターとしても活躍します', 1),
(1618, 'J-Kepes', 24135, 119, '2023-12-29 12:25:40', 0, 0, 'ニュアンスのある絶妙なカラーリングが魅力のボンバージャケット\r\nガーメントダイ加工のナイロン素材を採用しています\r\n胸元にはカットアウトされたメタルオーバルDロゴをあしらい、シャープなアクセントに\r\n肩に施されたステッチやランダムな立体感を作り出すギャザーなど、細部まで丁寧に作られた一着となっています\r\nフロントにウェルトポケット付き', 1),
(1619, 'J-Green', 7087, 65, '2023-12-29 12:26:18', 0, 0, 'リンクル（シワ）加工のライトナイロン生地にコントラストカラーのパイピングを施したフード付きジャケット\r\nルーズフィットのリラクシーなシルエットとなっています\r\nフロントのジッパープラーに「DIESEL」の刻印があるほか、左袖にはエンブロイダリーのDロゴを配置\r\nフードと裾はドローストリングで絞ることができ、袖口はゴムギャザーになっているので、防風性の高い仕様となっています', 1),
(1620, 'S-Boxt-N5', 42790, 40, '2023-12-29 12:27:26', 0, 0, 'メガサイズのオーバルDロゴが復活\r\nフロントのフロッキーロゴプリントがアイコニックなスウェットの登場です\r\nリラックスフィットで身幅にゆとりを持たせつつ、ネックラインや袖口、裾はストレッチリブで引き締めました\r\nコットンならではのソフトなタッチで着心地も良く、秋冬のカジュアルスタイルに重宝する一枚です', 1),
(1621, 'K-Zannis', 16385, 33, '2023-12-29 12:28:14', 0, 0, 'ウールカシミアブレンドを12ゲージのプレーンジャージー編みで仕上げたニットカーディガン\r\n胸元にはカットアウト仕様のエンブロイダリーDロゴがあしらわれており、ディーゼルらしいクールなスパイスをとなっています\r\nハイゲージニットならではのなめらかな風合いで、肌当たりも良好\r\nボタンを閉じてプルオーバー風にスタイリングするのもおすすめです\r\n環境に配慮された素材を使用しています', 1),
(1622, 'K-Larence-B', 13024, 112, '2023-12-29 12:31:02', 0, 0, '12ゲージのプレーンジャージー編みと特殊なプリントを組み合わせた長袖ニット\r\n程よい光沢となめらかさが特徴のガスコットンを採用しています\r\n左袖にはオーバルDのロゴ入り\r\nレギュラーフィットのため着回しやすいうえ、ニュアンスのあるカラーリングなので、一枚使いでもファッショナブルに着こなすことができます\r\n', 1),
(1623, 'P-Gold-Tech', 40877, 62, '2023-12-29 12:32:28', 1, 0, 'リンクル（シワ）加工のライトナイロン生地にコントラストカラーのパイピングが印象的なレギュラーフィットのパンツ\r\n左前にはトーンオントーンのエンブロイダリーDロゴをあしらい、さりげなくもディーゼルを象徴するワンポイントにしています\r\nウエストバンドは伸縮性＆ドローストリングで、フィット感の調節が可能\r\n裾にもドローストリングが備わっています\r\nポケットが前後それぞれに付いているなど、機能性にもこだわられた一本です', 1),
(1624, 'Ann45-T-Boxt', 9749, 70, '2023-12-29 12:33:28', 0, 0, 'DIESELの45周年を記念してデザインされたTシャツ。\r\nアーカイブのキャンペーンやカタログから切り抜いたレトロなロゴグラフィックをカラフルに組み合わせたジェンダーレスなデザイン。\r\nリラックスしたエフォートレスなシルエット。\r\nリサイクル繊維を使用し、伸縮性に富んでいるので着心地も抜群です。', 1),
(1625, 'T-Nabel-Face', 32370, 40, '2023-12-29 12:34:41', 0, 0, '左チェストに今シーズンのストーリーの1つである「SMILY FACES」プリントが施されたポップで遊び心のあるDIESELらしい1着に\r\nドロップショルダーシルエットがカジュアルスタイルをクラスアップ\r\nデニムなどのスタイリングでデイリー使いしやすい万能アイテムです', 1),
(1626, 'T-Nibe-Ls', 3767, 75, '2023-12-29 12:35:24', 0, 0, '今シーズンのストーリーの1つである「SMILY FACES」プリントが存在感を放つロングスリーブトップス\r\n特殊なプリントとヒートプレス転写のプロセスによって仕上げられた鮮やかな発色がクールな雰囲気を醸し出します\r\nトップにシャイニーコーティングを施すことでハリ感が生まれ、上質な仕上がりに', 1),
(1627, 'T-Cramivolkk-Ls', 37055, 73, '2023-12-29 12:36:04', 0, 0, 'マーブル模様のスペシャルなカラーリングが魅力的なログスリーブトップス\r\nレイヤード仕様のTシャツに、「Oval D」のデジタルプリントを施し、外側のファブリックのみにカットアウトのディテールをプラス\r\n手の込んだデザインが存在感を放ちます\r\nネックとショルダー部分には、オーバーロックステッチを採用し、立体感のある仕上がりに\r\n上質なコットンを100%使用した、ストレスフリーな着用感も嬉しいポイントです', 1);
INSERT INTO `clothes` (`id`, `clothesName`, `price`, `stock`, `date`, `clickCounter`, `buyCounter`, `productText`, `userid`) VALUES
(1628, 'T-Ashimi', 30369, 122, '2023-12-29 12:36:51', 0, 0, '全体にダーティー加工、エッジにディストレス加工を施し、ハンドメイドのスポンジでディテールを表現\r\n手の込んだデザインは圧倒的な存在感を放ちます\r\nソフトで立体感のあるワッフルコットン生地は、ラギッド過ぎない絶妙なミリタリームードを醸し出します', 1),
(1629, 'T-Ibe-M1', 30289, 58, '2023-12-29 12:37:34', 1, 0, 'ヴィンテージムード漂うオールオーバープリントが魅力的なストレッチリブTシャツ\r\n全面プリントを施した生地に、特殊なスプレーを塗布し、まるでウォッシュ加工が施されたかのような精密なデザインが唯一無二の存在感を放ちます\r\nフロントにメタリックプリントで表現されたロゴグラフィックがモダンな雰囲気をプラス', 1),
(1630, 'T-Erme', 11038, 102, '2023-12-29 12:38:12', 1, 0, '繊細なシースルーディティール加工が美しいトップス\r\nトロンプルイユ技法でデザインされた生地に、シアー部分を作り出すバーンアウトプリントが施された手の込んだデザイン\r\n唯一無二の存在感を放ちます', 1),
(1631, 'Straight Jeans 2010 D-Macs 068jh', 39243, 97, '2023-12-29 12:38:44', 1, 0, 'ストリートやヒップホップからンスパイアされたルーズフィットモデル「2010」\r\nレギュラーライズとストレートレッグのクラシックな5ポケットスタイルは、リラックス感のある穿き心地が絶妙なデニムパンツ\r\n程よいシースルーディテール加工は他にはない、ワンランク上のカジュアルスタイルが実現します\r\nルーズシルエットを採用することで、ストレスフリーな着心地とこなれ感を演出\r\n同品番のジャケット(A12554068JH)とのセットアップコーディネートもおすすめで', 1),
(1632, 'L-Kauffman', 45128, 47, '2023-12-29 12:39:50', 0, 0, 'リアルなヴィンテージ加工が目を惹くダブルブレストのトレンチコートレザー\r\n柔らかく滑らかな手触りが特徴なラムスキンレザーに、光沢のある透明なコーティングを施しており細部にまでこだわった一枚\r\n無駄のない洗練されたデザインはロング丈ながらも軽やかな着心地に', 1),
(1633, 'L-Bat', 26539, 76, '2023-12-29 12:40:32', 0, 0, 'シープスキンを使用した、フード付きレザーロングジャケット\r\nチェストとフロントには印象的なフラップ付きパッチポケット\r\n全体に施されたヴィンテージ加工や裾のカットオフディティールによって、クールなアイテムに仕上がっています', 1),
(1634, 'T-Just-Od', 40364, 34, '2023-12-29 12:42:17', 1, 0, 'DIESELブランディングの代名詞でもあるオーバルDロゴがフロントに施されたTシャツ\r\n使い勝手の良いTシャツはシンプルなデザインで仕上げており、幅広いコーディネートにマッチ\r\n控えめなサイズ感で施されたフロントロゴはカジュアルなアイテムながらも洗練された大人らしい印象に\r\nカーディガンやジャケットなどのインナーとしても活躍\r\n一枚あると重宝するマストハブアイテムです\r\n', 1),
(1635, 'S-Ginni-Zip-Od', 37878, 55, '2023-12-29 12:43:07', 1, 0, '胸元のオーバルDロゴがポイントになったジップアップスウェット\r\nすっきりとしたハイネックのスウェットをさらっとカーディガン感覚で使えるシンプルデザイン\r\nありそうでなかった一枚であり、飽きが来ないので様々なコーディネートに活用できます\r\nロングシーズンで活躍できる便利アイテムです！', 1),
(1636, 'S-Macsis-Od', 32170, 105, '2023-12-29 12:45:48', 1, 0, '着る人を選ばない上品なシルエットが使い勝手のいいスウェットプルオーバー\r\n厚手過ぎない程よい生地で、柔らかい着心地が〇\r\nトレンド感のあるフォルムはシンプルながらもコーディネートに取り入れることでこなれたスタイルに\r\n主張の控えめなデザインはプリントアイテムやポップなカラーアイテムなどとも相性〇\r\nスリーブに施されたオーバルＤロゴディティールがさり気ないアクセントになっています', 1),
(1684, '[Fasshonrida] ジップパーカー メンズ 秋服 フルジップ ラグランぱーかー 大きいサイズ 上着 かっこいい ジップアップパーカー フード付き トレーナー ZIP ライトアウター オシャレ 服 配色切替 秋 冬 春', 3780, 122, '2024-01-19 22:11:12', 9, 0, '暖かく柔らかいコットンと、毛玉になりにくく型崩れしにくいポリエステルのＴＣ混紡素材を使用しています。裏地等はあえて付けず自然な柔らかさを大事に仕上げました。\r\n身頃と袖・フードなど各部分の配色切替でセンスアップ間違いなしのメンズラグランパーカーが新登場! ラグランスリーブでスッキリしているのに、ゆるくこなれた感じで着こなせます。動きを邪魔しないシルエット。着ていくほどにお気に入りとなるでしょう。\r\n2重仕上げでしっかりと作られたフード。奥行き、高さともたっぷりサイズで作られたフードはオンの時こそサマになる設定。フロントはシングルジップになっており着脱しやすいアイテムです。両サイドにはポケットを添えて実用性にもこだわりました。\r\n裾と袖口はリブですっきり着こなし。風の侵入も防いで防寒性もOK! インナーを着込みやすくリラックス感を演出できるゆったりフィット。程良い伸縮性のあるストレスフリーな着心地でルームウェアからタウンユース、スポーツ時など幅広くお使いいただけるアイテムです。\r\n『お買い物あんしん』 サイズやカラーがイメージと異なる場合は交換・返品も無料。つまり試着ができちゃうってことですよ。レディス＆ジェントルマンのみなさま安心して衣類をお選びください！\r\n『お客様へのお約束』 当店はお客様に最高のショッピング体験をお楽しみいただけますよう、最高水準のサービスを提供することをお約束します。当店でお買い物の際、何かご不明な点がございましたら、メールにてお気軽にお問い合わせください。お客様に問題なくお買い物をお楽しみいただけるよう、最善を尽くします。ご来店を心よりお待ち申し上げております。', 1),
(1689, '[ｂｌｕｅｆｅｅｌ] パーカー メンズ 秋服 スウェット トレーナー 大きい サイズ ゆったり ジャケット フード 付き 人気 ストリート トップス カジュアル おしゃれ 春秋冬服', 3128, 121, '2024-02-02 15:51:06', 5, 1, '【柔らかく快適】良質で柔らかい天然綿素材で仕上げております、生地はとても柔らかくて滑らかで、肌にとても優しいです。快適さは満点を得ることができます！とした肌触りの良さで、いい着心地です。ふんわり柔らかなコットンの素材で、ノーストレスのよい着心地です。 通気性も優れており、型崩れもしにくい。\r\n【活躍シーン】ジーンズやスラックスとの組み合わせがやすく、どんなシーンでもスタイリッシュに着ることができます！シンプルなデザインで広範な調整に使用できます。靴は、スニーカーはもちろん､スポーツ系やマーチンシューズのような革靴でもOK｡サコッシュ､ボディバッグ､キャップ､バケットハットなどの小物とも相性抜群でおしゃれスタイルに｡\r\n【おしゃれ　デザイン】通勤·通学·カジュアルコーディにもスポーツ·アウトドアにも活躍できるメンズ長袖パーカーです。ゆったりしたシルエットで、体型カバーできて、爽やかな印象を与えてくれる、これからの秋冬に最適なプルオーバーパーカーです。\r\n【着回し力抜群】新世代の捺染技術を採用して、色の固定性が高くて、色おちなく、そして専門の裁縫技術を備えて、糸がきれいで、裁縫は更に堅固で細かいです。立体的な裁断とのデザインは良い着心地を実現。定番アイテムとして人気の高いトレーナーですが、そこにビッグシルエットが加わることでよりこなれ感や今っぽさを演出でき、コーデの主役としても活躍する存在感に。\r\n【メーカー保証】丁重に声明する：購入後30日以内に、ご不満があった際は、返品 返金対応いたします。Kuface Store（ブランド: ｂｌｕｅｆｅｅｌ）で購入した商品に品質保証、無料交換/返 品などのサービスを提供しております。', 3),
(1690, 'T-Uncserafin', 39600, 60, '2024-02-02 17:10:09', 1, 0, '複数のロゴグラフィックを落とし込んだアイコニックな長袖Tシャツ\r\nフェルトパッチやフロッキープリントを駆使し、手の込んだ一枚に仕上げています\r\nところどころにブリーチスプレーを施した、ビンテージ調のルックスも◎\r\n軽やかなコットンジャージー製で肌馴染みも良く、着心地も快適なアイテムです', 3),
(1691, 'T-Regs-N6', 27500, 80, '2024-02-02 17:14:33', 1, 0, '今シーズンのカモフラージュプリントを落とし込んだTシャツ\r\nプリントはゼブラなどの動物的なパターンからインスピレーションを得ています\r\n前身頃にはタイニーロゴパッチと高密度のスパイラルプリントを重ね、よりアイコニックなビジュアルに\r\nコットンジャージー生地を採用した、ソフトな仕上がりも魅力の一枚です', 3),
(1692, 'T-Reg-Div', 13200, 70, '2024-02-02 17:19:18', 1, 0, 'フロントにエンブロイダリーで施されたDIESELブランディングが存在感抜群のTシャツ\r\n90年代に大ブレークしたディーゼルのブランディングをリバイバルしたロゴデザイン\r\n着心地の良い柔らかで上質なコットン素材が大人カジュアルスタイルにぴったり\r\nレギュラーフィットだから幅広いスタイリングに馴染む今シーズンのマストハブアイテム', 3),
(1693, 'Bootcut And Flare Jeans D-Akii 09h95', 36300, 78, '2024-02-02 17:25:25', 0, 0, '・フロントセンターラインとボリュームのあるレッグが特徴的なモダンフレアデニム「D-AKII」\r\n・パッチポケットやフロントとバッグの切り替えディテールなど360度こだわった新作美脚デニム\r\n・ジッパーフライ\r\n・ストレッチなし\r\n・クリーンな印象のライトブルーデニム', 3),
(1694, 'Bootcut And Flare Jeans D-Akii 068hn', 33000, 80, '2024-02-02 17:26:57', 0, 0, '・フロントセンターラインとボリュームのあるレッグが特徴的なモダンフレアデニム「D-AKII」\r\n・パッチポケットやフロントとバッグの切り替えディテールなど360度こだわった新作美脚デニム\r\n・ジッパーフライ\r\n・ストレッチなし\r\n・オーセンティックなウォッシュデニム\r\n', 3),
(1695, 'Straight Jeans 1996 D-Sire 09h58', 59400, 60, '2024-02-02 17:27:57', 1, 0, '', 3),
(1696, 'Straight Jeans 1996 D-Sire 09h60', 60500, 70, '2024-02-02 17:47:51', 0, 0, '・ルーズフィットスタイルの美脚モデル「D-SIRE」\r\n・ヒップまわりはタイトでそこから大胆に広がったボリューム感が圧倒的な存在感を放つ\r\n・ボタンフライ\r\n・上質なコットンを100％使用したノンストレッチデニム\r\n・日焼けによる色あせやヴィンテージ感を再現\r\n', 3),
(1697, 'Bootcut And Flare Jeans 1978 D-Akemi 0dqac', 36300, 66, '2024-02-02 17:49:26', 0, 0, '・70年代のディスコ（クラブ）からインスピレーションを得たスリムモデル「1978」\r\n・程よい裾広がりのフレアレッグで、脚長\r\n・美脚効果抜群のフェミニンムード漂うデニム\r\n・ジッパーフライ\r\n・ストレッチ素材混\r\n・ダメージ加工をを加えたダークウォッシュデニム', 3),
(1698, 'M-Teri', 69300, 25, '2024-02-09 17:26:09', 0, 0, 'インディゴ染めにウォッシュ処理を施したスリムフィットのニット\r\nハイゲージの繊細な凹凸と清涼感のあるカラーリングがマッチした一枚です\r\n胸元はオーバルDのメタルプレートをあしらい、シャープでアイコニックなワンポイントに\r\nコットン製ニット生地ならではのやわらかさや程よいハリ感も魅力です', 4),
(1699, 'M-Janel', 70400, 36, '2024-02-09 17:29:47', 0, 0, 'コントラストの効いた大胆で美しい配色がポイントのニット\r\nタイダイウォッシュ加工を採用しているので、ところどころに濃淡があるのも特徴的です\r\n5ゲージのケーブル＆リブ編みの立体的な表情も◎\r\nバックネックにはメタルのオーバルDロゴが配置されています\r\n深いVネックのため、インナーにカットソーを合わせたスタイリングもおすすめです', 4),
(1700, 'M-Arte', 55000, 23, '2024-02-09 17:32:52', 0, 0, '今シーズンのウールカシミヤウェアには、カットアウト仕様のエンブロイダリーDロゴを配置\r\n12ゲージのプレーンジャージー編みで仕上げたニットカーディガンの登場です\r\nハイゲージニットならではの繊細な表情や絶妙な光沢感、なめらかな風合いなど、シンプルながらもラグジュアリーさが光る一枚\r\nスリムフィット＆クロップドレングスなので、プルオーバー感覚でスタイリングしてもバランス良く決まります\r\n本製品には、最適な土地管理がなされている農場で、動物福祉に配慮して育てられた羊の毛を用いた認証ウールと、認証リサイクルカシミヤを使用しています', 4),
(1701, 'G-Khlow-N1', 69300, 28, '2024-02-09 17:35:46', 0, 0, 'ビスコーステンセルサテン生地で仕立てたラグジュアリーなボンバージャケット\r\n袖などの色褪せ感は、ブリーチスプレーを使用し手作業で施されています\r\n中央のジッパーにはタイニーロゴを象ったプラーを採用し、さりげなくもディーゼルらしさが宿るワンポイントに\r\n裾に伸縮性があるので、レギュラーフィットながらややコンパクトな印象で着用できます\r\nサイドにジッパー仕様のポケット付きです', 4),
(1702, 'P-Mirow-N1', 64900, 28, '2024-02-09 17:37:01', 0, 0, 'ビスコーステンセルサテン生地で仕立てたラグジュアリーなカーゴパンツ\r\n部分的な色褪せの表情は、ブリーチスプレーを使用し手作業で施されています\r\nとろみ感のあるなめらかな風合いも特徴のひとつ\r\nウエストと裾はゴムになっているので、リラクシーながら程よくフィットするデザインとなっています\r\nサテンならではの高級感とカーゴディテールのスポーティさが程よくミックスされた一本です', 4),
(1703, 'P-Martyn', 50600, 45, '2024-02-09 17:38:36', 0, 0, 'コットンベースのシェニール生地に色あせ効果を施したスウェットパンツ\r\nガーメントダイやランダムアシッドウォッシュ加工などを使い、ビンテージ感のあるビジュアルに仕上げています\r\nルーズフィットのワイドレッグや伸縮性のあるウエストバンドなど、リラクシーなはき心地も魅力的\r\nフロントにはラインストーンでロゴを表現しました\r\nしっとりとした風合いで、手触りの良い一本です\r\nサイドポケット付き', 4),
(1704, 'F-Kinigli', 57200, 48, '2024-02-09 17:40:40', 0, 0, '\r\nコットンベースのシェニール生地に色あせ効果を施した、スタンドカラーのジャケット\r\nガーメンドダイやランダムアシッドウォッシュ加工などを用いて、表情豊かに仕上げています\r\n首元と袖口、裾はストレッチ入りのリブで切り替え、フィット感をプラス\r\nジッパープラーに採用されたアイコンのオーバルDプラークや、胸元のラインストーンのロゴなど、各所にディーゼルのエッセンスを落とし込んでいます', 4),
(1705, 'T-Ele', 18700, 31, '2024-02-09 17:49:35', 0, 0, 'ハートとDロゴプリントの組み合わせがアイキャッチなスキニーフィットTシャツ\r\nクルーネックラインやアームホール、袖口などにコントラストカラーのステッチワークをあしらい、アクセントにしました\r\nコットンを使用したストレッチリブ生地で、肌馴染みが良く着心地も快適\r\nコンパクトなので、一枚使いでも、羽織りやドレスとのレイヤリングも楽しめる汎用性の高いアイテムです', 4),
(1706, 'T-Buxt-N4', 18700, 19, '2024-02-09 17:51:22', 0, 0, 'ハートとDロゴを組み合わせたプリントがアイコニックなTシャツ\r\nその上からDIESELのロゴを重ね、クールなアクセントにしました\r\nやわらかなコットンジャージー生地に色あせ効果を加え、ユーズド感のあるこなれた印象を演出\r\nデザイン性に長けているほか、ルーズフィットでゆるっと着用できるので、デイリーのカジュアルウェアとして重宝します', 4),
(1707, 'T-Boxt-Japan-Yy', 19800, 32, '2024-02-09 17:54:00', 0, 0, 'DIESEL × YUKINO YAMANAKA 「POSE」展の開催を記念して、ディーゼルと山中雪乃のコラボレーション によるアイテムが登場', 4),
(1708, '銭湯のススメ2024 / Long Sleeve Tee shirt', 7150, 29, '2024-02-09 18:09:29', 3, 0, '「銭湯のススメ」のためにイラストレーターの田渕周平氏がイラストを描き下ろし。\r\n〈牛乳石鹸〉を象徴する牛と〈都バス〉のマスコットキャラクター「みんくる」が仲良くお風呂に入っている姿が描かれています。袖に施されたプリントがアクセントとして存在感を発揮。\r\nゆとりのあるシルエットで1枚でも様になるロングスリーブTシャツです。', 4),
(1709, 'Demi-Luxe BEAMS / ドット ジャカード ブラウス', 26400, 31, '2024-02-09 18:13:58', 0, 0, '■デザイン\r\nボリュームのあるドット柄をカットジャカードで表現した華やかなブラウス。1枚ではもちろん、ジャケットのインナーとしても活躍する1枚です。\r\n\r\n■ディテール\r\n端正さをプラスするコンパクトなバンドカラーがポイントです。\r\n\r\n■サイズ\r\n身体のラインを拾わない適度なゆとりのあるシルエット。タックイン、アウトどちらもサマになる絶妙な着丈です。\r\n\r\n■素材\r\nエレガントなムードを演出するとろみのあるテキスタイル。程良い透け感が大人の甘さをプラスします。\r\n', 4),
(1710, 'T-Uncyna', 55000, 34, '2024-02-22 07:54:02', 0, 0, '2024年春夏ランウェイショーコレクションのTシャツ\r\nシースルーのチュール生地とバーンアウト加工されたコットン生地を重ねています\r\n剥離効果で肌を露出した印象的なデザインになっており、胸元にあるエンブロイダリーのタイニーロゴがアクセントです', 4),
(1711, 'T-Bialik', 49500, 13, '2024-02-22 07:56:18', 0, 0, '2024年春夏ランウェイショーの主要テーマである、ディーゼルの映画ポスターのシリーズです\r\nミニマルなシルエットで、テクニカルジャージーの上に軽やかなコットンを重ね、カモフラージュ柄にオーバーステッチを施しています\r\nトップ生地はアイコニックなオーバルDロゴのプリントがほとんど見えないほど、独特のピール（剥がす）オフ（外す）加工が施されています', 4),
(1712, 'P-Stellar', 55000, 49, '2024-02-22 07:59:03', 0, 0, '夜の水面に映る輝く星をモチーフにした総柄プリントが特徴のローウエストブーツカットフレアパンツ\r\nアセテートナイロンのストレッチサテン生地に採用した、軽くスムースな風合いもポイントです\r\n5ポケットタイプで、コインポケットにはディーゼルインダストリーのフラッグラベルを配置\r\nフロントボタン＆ジッパーで着脱するベーシックな仕様です\r\n', 4),
(1713, 'C-Lind', 41800, 49, '2024-02-22 08:00:10', 0, 0, '神秘的な総柄プリントを落とし込んだ、スリムフィットの長袖シャツ\r\nプリントは夜の水面に映る輝く星をコンセプトにしており、繊細なタッチとカラーリングが魅力的です\r\nバックネックにはオーバルDのメタルチャームを取り入れ、ラグジュアリーなアクセントに\r\nレーヨンコットン製なのでやわらかくなめらかな着心地を実感できます', 4),
(1714, 'S-Dou-Plain', 31900, 38, '2024-02-22 08:01:50', 1, 0, 'Dロゴのエンブロイダリーが圧倒的な存在感をアピールするオーバーフィットシャツ\r\nヒップを隠せる丈感が嬉しいポイント\r\nスキニーやショートパンツなどのコンパクトなボトムとの相性はもちろん、ボリュームのあるワイドパンツとの合わせも今ドキなハイファッションに仕上げてくれます\r\n夏の羽織りとしても万能で着回しのきくアイテムです\r\n秋冬はロンTやスウェットとのレイヤードもおすすめ\r\nシーズンレスでお使い頂けます', 4),
(1715, 'C-Lory', 46200, 32, '2024-02-22 08:03:15', 0, 0, 'フロントにサテン、バックにカラーブロックのダブルニットを採用した異素材ミックスのジップアップシャツ\r\n切り替えラインにはサテンのパイピングを採用しました\r\n中央を走るジッパーにはオーバルDロゴの形をしたプラーを使用し、クールなアクセントに\r\nボディラインをすっきりと引き立ててくれるスリムフィットシルエットの一枚です', 4),
(1716, 'C-Dou-Stripe', 35200, 43, '2024-02-22 08:07:07', 0, 0, 'リッチな素材感が大人の雰囲気漂うベーシックなストライプシャツ\r\nさらりとした肌触りの良いコットン100％素材を使用し、程よいルーズなフィットが抜け感を演出します\r\nフェミニンカラーのDロゴがアクセントになった華やかな一枚は、軽い羽織りとしてもおすすめ\r\nヒップが隠れる長さでスリムからワイドまで幅広いデニムにもマッチ\r\n細めストライプがすっきりとスタイルアップ効果もあります\r\nベーシックでありながらトレンド感も兼ね備えたマストハブアイテムです', 4),
(1717, 'T-Reg-G9', 14300, 56, '2024-02-22 08:10:22', 0, 0, '立体感のあるオーバルDロゴを施したシンプルなレギュラーフィットTシャツ\r\n伸縮性があり、着心地も良い一枚は、派手過ぎずシンプル過ぎない、バランスのとれた一枚です\r\nキレイめスタイルなど幅広いスタイリングにもマッチする春夏シーズンのマストハブアイテムです', 4),
(1718, 'T-Sli-G3', 16500, 68, '2024-02-22 08:12:27', 0, 0, 'ピグメント加工を施し程よいヴィンテージのような風合いが印象的な半袖Tシャツ\r\nフロントのオーバルロゴは、シンプルながらも存在感を放ち、スタイル全体にアクセントをつけてくれます\r\nいつものデニムスタイルをアップデートしてくれる最新Tシャツは今シーズンのマストハブアイテム', 4),
(1719, 'T-Reg-Div', 13200, 32, '2024-02-22 08:14:29', 0, 0, 'フロントにエンブロイダリーで施されたDIESELブランディングが存在感抜群のTシャツ\r\n90年代に大ブレークしたディーゼルのブランディングをリバイバルしたロゴデザイン\r\n着心地の良い柔らかで上質なコットン素材が大人カジュアルスタイルにぴったり\r\nレギュラーフィットだから幅広いスタイリングに馴染む今シーズンのマストハブアイテム\r\nお気に入りのデニムとのスタイリングがおすすめです\r\n同シリーズのコットンワンピース（品番：A050910GRAI）の展開もござい', 4),
(1720, 'Awtee-Betsy-Ht14', 13200, 21, '2024-02-22 08:15:58', 0, 0, '・コットンとリサイクルポリ素材のクロップド丈Tシャツ\r\n・伸縮性抜群のストレッチ素材で速乾性もあり、スポーツシーンで大活躍\r\n・袖のネオンカラーのテープ、コントラストの効いたステッチ、薄い２トーンのリブ付きのクルーネック、裾は切りっぱなし仕上げなどこだわりのディテール', 4),
(1721, 'Awtee-Norah-Wt13', 15400, 45, '2024-02-22 08:17:55', 0, 0, '・リサイクルポリ素材のクロップド丈Tシャツ\r\n・デジタルカモフラージュ柄がシックでクールな印象\r\n・伸縮性抜群のストレッチ素材で速乾性もあり、スポーツシーンで大活躍\r\n・コントラストの効いたステッチ、２トーンのリブ付きのクルーネックなどこだわりのディテール', 4),
(1722, 'Awwb-Eliza-Ht43', 41800, 43, '2024-02-22 08:21:26', 0, 0, '・軽量リサイクルナイロン素材のパンツ\r\n・シャイニーなピクセルプリントにサイドのネオンカラーのテープがアクセント\r\n・裾はゴム入りカフス、サイドジップでシルエットの変化を楽しめるアクティブなパンツ\r\n・吸汗速乾性のあるメッシュのライナーでスポーツシーンでも大活躍', 4),
(1723, 'M-Teri', 69300, 43, '2024-02-22 08:23:40', 1, 0, 'インディゴ染めにウォッシュ処理を施したスリムフィットのニット\r\nハイゲージの繊細な凹凸と清涼感のあるカラーリングがマッチした一枚です\r\n胸元はオーバルDのメタルプレートをあしらい、シャープでアイコニックなワンポイントに\r\nコットン製ニット生地ならではのやわらかさや程よいハリ感も魅力です', 4),
(1724, 'De-Top1-Fse', 128700, 43, '2024-02-22 08:25:26', 0, 0, '2024年春夏ランウェイショーコレクションのクロップド丈長袖カットソー\r\nラウンドネックとセカンドスキンフィットが特徴です\r\nまた、このポップな色合いのウォッシュ加工は、まるで第二の肌のように体にフィットするスーパーストレッチデニムを使用し、オーバーダイ加工と専用のアートワーク加工を施すことで、ウィスカー加工やユーズド加工を再現しています\r\nキラキラと輝く仕上がりは、生地にプレスされたマイラー箔によるもので、ヴィンテージ感を高めています\r\n胸元にはクリスタルを散りばめたオーバルDロゴのプレートが差し込まれ、カットアウトされた部分からのさりげない肌見せによってシースルー効果を生み出しています', 4),
(1725, 'T-Lastek', 33000, 65, '2024-02-22 08:27:07', 0, 0, 'リブとマーブルウォッシュのコンビネーションが新鮮な長袖Tシャツ\r\n全体を同系色でまとめつつもコントラストがあり、ユニークで遊び心のあるビジュアルに仕上がっています\r\nバックネックにはオーバルDのエンブロイダリーロゴを配置\r\nストレッチ入りの生地を使用したスキニーフィットで、ワイドボトムやフレアスカートと相性抜群です', 4),
(1726, 'T-Uncutie-Long-N5', 27500, 45, '2024-02-22 08:28:54', 0, 0, 'チョークエフェクトのウォータープリントアートワークが印象的なスリムフィットのTシャツ\r\n前後にそれぞれフロッキープリントのロゴを重ね、アイコニックなポイントにしています\r\nコットンジャージー製ならではのやわらかな手触りも魅力のひとつ\r\nコンパクトなクロップド丈なので、ワイドパンツやロングスカートと相性抜群です', 4),
(1727, 'P-Mirow', 83600, 43, '2024-02-22 08:30:09', 0, 0, 'ゼブラなどの動物的なパターンからインスパイアされたカモフラージュプリントの総柄カーゴパンツ\r\n複数のフラップ＆ジップポケットがポイントで、ユーティリティかつミリタリーな一本に仕上がっています\r\nテンセルツイル生地を使用しており、なめらかなタッチと光沢感も魅力的\r\nウエストバンドと裾は伸縮性のある仕様となっています\r\n左サイドの上部ポケットにトーンオントーンのエンブロイダリーDロゴ付きです', 4),
(1728, 'G-Khlow', 88000, 38, '2024-02-22 08:31:57', 0, 0, 'ゼブラなどの動物的なパターンからインスパイアされたカモフラージュプリントの総柄ボンバージャケット\r\n生地には光沢となめらかな風合いが特徴のテンセルツイルを採用しました\r\n胸元に配置した複数のポーチポケットが、ミリタリーな雰囲気をさらにアップ\r\nクロップド丈で且つ裾に伸縮性があるので、すっきりとしたコンパクトなスタイリングが楽しめます\r\n後ろ身頃から袖にかけての繊細なシャーリングにも注目したい、手の込んだ一着です\r\n左側にオーバルDロゴが添えられています', 4),
(1729, 'T-Buxt', 41800, 54, '2024-02-22 08:34:09', 0, 0, 'フォイルディテールのメタリックなカラーリングが特徴のTシャツ\r\nアシッドウォッシュ加工を施していることにより、適度にビンテージ感があるのもポイントです\r\nフロントの左裾には、オーバルDのエンブロイダリーロゴをプラス\r\nドロップショルダー＆ルーズフィットシルエットで、ゆとりのあるエフォートレスな着心地を楽しめます', 4),
(1730, 'Super Skinny Jeans 2017 Slandy 09f90', 31900, 43, '2024-02-22 08:35:58', 0, 0, 'タイムレスでエッジの効いたロッカーからインスピレーションを得たスーパースキニースタイルは、スーパーストレッチ素材で、ミッドウエスト、ジッパーフライが施されたオーセンティックなモデル「2017 SLANDY」\r\n無駄のないスーパースキニーフィットは、美脚効果も高くレギンス感覚でレイヤードスタイルにも使い勝手の良いマストハブアイテム', 4),
(1731, 'Slim 2051 D-Ursy Track Denim 09h05', 63800, 41, '2024-02-22 08:37:21', 0, 0, 'スウェット素材を使用したJOGGJEANSからNEWスタイル「D-URSY」が登場\r\n3Dポケットを施したトレンドのカーゴパンツは、程よいスキニーシルエットが抜け感を演出し、大人のスポーティースタイルが実現します\r\nウエストのドローストリングもトレンドを感じさせます\r\n足元をスニーカーからヒールに変えるだけでイメージを変えられる幅広いスタイルにマッチする万能モデルです', 4),
(1732, 'T-Uncutie-Long-M2', 59400, 65, '2024-02-22 08:38:57', 0, 0, '上質なコットンを100%採用した半袖トップス\r\nロゴパッチはサテンステッチ刺繍で仕上げ、仕上げにオーバープリントを施すことで抜け感と存在感を演出します\r\nデザイン性の高いトップスは、デイリースタイルを華やかにアップデートしてくれます', 4),
(1733, 'T-Clauzi-M1', 63800, 12, '2024-02-22 08:41:16', 0, 0, '23FWシーズンストーリーでもある「SMILY FACES」のオールオーバープリントがインパクトたっぷりなロングスリーブトップス\r\nポップな印象を持ちつつも程よく身体のラインを拾ってくれる美シルエットがフェミニンな印象も感じさせます\r\nポリエステルにストレッチ素材を混紡させており、伸縮性と耐久性に優れています\r\nさらにクリア箔コーティングを施すことでハリ感が生まれ、リッチな質感に\r\nいつものコーディネートに彩りを添えてくれるフレッシュなアイテムです', 4),
(1734, 'De-Bob-Fsd1', 63800, 33, '2024-02-22 08:44:40', 0, 0, 'リアルデニムのような繊細なデザインがユニークなロングスリーブトップス\r\n生地にはソフトで柔らかなストレッチ素材を使用しており、スリムフィットながらもストレスフリーな着心地を実現しています\r\n1枚1枚丁寧に加工を施し、絶妙にフェードがかかったミディアムインディゴブルーカラーは、どのようなスタイリングにもマッチします\r\n1枚着はもちろん、シャツやカーディガンのインナーとしてもお使い頂けます', 4),
(1735, 'M-Ikyla', 46200, 40, '2024-02-22 08:46:26', 0, 0, 'クロシェ編みがフェミニンムードたっぷりなロングスリーブニットトップス\r\n首元のパイピングデザインがスポーティーで抜け感もプラスします\r\nレース編みの女性らしいアイテムにディーゼルらしいストーンウォッシュを施し、ロゴをオン\r\nディーゼルらしい表情に仕上げた女性らしさの中にカジュアルさも兼ね備えた一枚です', 4),
(1736, 'Boyfriend Jeans 2016 D-Air 09g74', 31900, 33, '2024-02-22 08:47:40', 0, 0, 'コンテンポラリーなレギュラースタイルのデニムは、ミッドウエスト、 アンクルレングスのボーイフレンドデニム「2016D－AIR」\r\n身体のラインを強調しすぎないボーイフレンドレッグは、スタイリング次第できれいめにもカジュアルにも着こなして頂けます\r\nライトブルーの爽やかなカラーリングがフレッシュな印象を演出します\r\n春夏シーズンは足元をサンダルに、秋冬はブーツなど、シーズンレスでお使い頂ける大活躍なデニムです', 4),
(1737, 'T-Angie', 18700, 44, '2024-02-22 08:50:32', 0, 0, '胸元にあしらわれたカットアウト仕様のオーバルDロゴが印象的なTシャツ\r\nストレッチコットンジャージー生地を採用していて、ボディラインに程よくフィットする仕上がりとなっています\r\n手触りもなめらかで、着心地も良好\r\nコンパクトなシルエットなので、シャツやカーディガン、ジャケットのインナーアイテムとしても使いやすく、一枚あると幅広いスタイリングを楽しむことができます', 4),
(1738, 'Straight Jeans 1996 D-Sire 09h58', 59400, 22, '2024-02-22 08:52:05', 0, 0, '・ルーズフィットスタイルの美脚モデル「D-SIRE」\r\n・ヒップまわりはタイトでそこから大胆に広がったボリューム感が圧倒的な存在感を放つ\r\n・ジッパーフライ\r\n・ストレッチなし\r\n・デストロイ加工が施されたヴィンテージ感のあるウォッシュ加工', 4),
(1739, 'T-Hilary-L1', 16500, 66, '2024-02-22 08:56:16', 0, 0, '大胆なピールオフのロゴグラフィックがアイキャッチたっぷりなロングスリーブTシャツ\r\n上質コットン100％のリッチな素材感が大人の女性にも大人気\r\n存在感のある一枚は、ロングシーズン通してデイリーに大活躍\r\nいつものデニムスタイルを華やかにブラッシュアップしてくれるマストハブアイテムです', 4),
(1740, 'T-Reg-L4', 13200, 33, '2024-02-22 08:57:36', 1, 0, 'フロントのアイコニックロゴがポイントになったレギュラーフィットのショートスリーブTシャツ\r\nシンプルなアイテムだからこそリッチな素材感にこだわり、着心地も抜群です\r\n程よい存在感と抜け感を演出できる、デイリーにマストな一枚です\r\nレギュラーフィットだからカジュアルになり過ぎず、きれいめのボトムスやフェミニンなスカートともすっきり合わせて頂けます', 4),
(1741, 'Awtee-Piper-A-Wt38', 14300, 48, '2024-02-22 08:59:13', 0, 0, 'シンプルデザインにネックのロゴがアクセントになったモックネックTシャツ\r\n吸汗・速乾性に優れ、汗をかいてもドライな着心地をキープし、アウトドアやアスレジャーアイテムとしても◎\r\nトレンドのスポーツMIXスタイルにも映える1枚です\r\n胸のオーバルロゴもさりげなく洗練されたシンプルデザインはデイリー使いに最適です', 4),
(1742, 'P-Leb', 49500, 40, '2024-02-22 09:00:32', 0, 0, 'ランダムにフォイル加工を施したメタリックなカラー使いが魅力のスウェットパンツ\r\nガーメントダイのコットンジャージー生地に、アシッドウォッシュ加工とフォイルディテールをプラスしたこだわりの一本です\r\n伸縮性のあるウエストバンドの内側にはドローストリングが付いているほか、パンツの前後にはポケットが付いているので実用性も◎\r\n左側にエンブロイダリーのDロゴが添えられています\r\nラフな印象の強いスウェットパンツをラグジュアリーに表現した、ディーゼルならではのアイテムです', 4),
(1743, 'T-Ribelle', 23100, 34, '2024-02-22 16:12:31', 0, 0, 'コンパクトで程よくボディに沿うシルエットがレディムードたっぷりなジャージートップス\r\nコントラストカラーのオーバーロックステッチが華やかでより一層フェミニンな印象をプラスします\r\nスタンダードなTシャツに飽きた方にトライしていただきたいファッショナブルなトップスは、いつものデニムスタイルをブラッシュアップしてくれます', 4),
(1744, 'T-Sli-Ovalace', 23100, 32, '2024-02-22 16:16:01', 0, 0, 'ストレッチコットンジャージー素材が肌触りの良いスリムフィットTシャツ\r\nレースの異素材使いがアクセントになった一枚は同系色のレースを使用しているため上品でエレガントな印象に\r\nフロントのオーバルⅮロゴもアクセントに\r\n女性らしいミニマムなシルエットがカジュアルなデニムスタイルをリッチで大人なスタイルに仕上げてくれます\r\n一枚で存在感を放つトップスは、カーディガンやシャツのインナーとしてロングシーズンお使いいただけます', 4),
(1745, 'T-Danny-L1', 16500, 46, '2024-02-22 16:19:32', 0, 0, '華やかな蝶のグラフィックがフェミニンなルーズフィットTシャツ\r\n身体のラインを拾いすぎない程よいゆとりのあるシルエットは、タックイン、タックアウトどちらのスタイルにもバランスの取りやすい一枚です\r\n3D刺繍のロゴがDIESELらしい遊び心とリッチな印象をプラス\r\n1枚着はもちろん、インナーとしても存在感抜群です', 4),
(1746, 'T-Urar-L1', 19800, 6, '2024-02-22 16:23:26', 0, 0, 'シャイニーな輝きをまとったモノグラムデザインが目を惹くノースリーブTシャツ\r\nポリウレタン混の柔らかな素材を使用しているので伸縮性も抜群です\r\n程よく体にフィットするコンパクトなシルエットでスタイルアップ効果も\r\n箔加工を施すことでナチュラルな中にも品のある質感に仕上がっており、いつものスタイリングをブラッシュアップすること間違いなし\r\n1枚着はもちろん、インナーとしても存在感抜群のアイテムです', 4),
(1747, 'M-Anaheim', 52800, 24, '2024-02-22 16:27:12', 0, 0, 'フロントのメタルプレートロゴが特徴的な半袖インディゴリブトップス。コットンにライクラを織り交ぜた素材を使用しているため、動きやすくしなやかな着心地と、快適なフィット感があります', 4),
(1748, 'M-Ileen', 79200, 38, '2024-02-22 16:31:33', 0, 0, 'サンブリーチエフェクト＆メタルコーティングのコンビネーションが新鮮なモックネックニット\r\nビンテージ風のカラーリングにフォイルを施し部分的に光沢を加えたファッショナブルな一枚です\r\nバックネックにはオーバルDのメタルプレートをオン\r\nコットン製のハイゲージニットウェアなので、適度なハリとやわらかさを持ち合わせています\r\nレイヤードスタイルにも活躍するスリムフィットのシルエットです\r\n', 4),
(1749, 'M-Gavdos', 68200, 37, '2024-02-22 16:34:59', 0, 0, '程よく肉厚なコットンリブ素材が心地良い長袖ニットトップス\r\nメタリックカラーのモノグラムを特殊な加工で全面にプリントしたスペシャルなシリーズ\r\n3D効果が存在感を放ち、他にはないディーゼルらしいアイテムに仕上がっています\r\n', 4),
(1750, 'M-Peris', 46200, 33, '2024-02-22 16:38:15', 0, 0, 'ウエスト部分の大胆なカッティングが印象的なニットトップス\r\nスリムフィットながら、ビスコース混の柔らかな素材を使用しているので伸縮性があり、ボディラインを拾いにくいリブニットが嬉しいポイント\r\nカット部分はハイウエストデザインでスタイルアップ効果も\r\nバランスのとれたヘルシーな着こなしが可能です\r\n1枚で肌見せするのはもちろん、インナーを合わせたレイヤードスタイルもおすすめ', 4),
(1751, 'M-Peris', 46200, 12, '2024-02-22 16:39:21', 0, 0, 'ウエスト部分の大胆なカッティングが印象的なニットトップス\r\nスリムフィットながら、ビスコース混の柔らかな素材を使用しているので伸縮性があり、ボディラインを拾いにくいリブニットが嬉しいポイント\r\nカット部分はハイウエストデザインでスタイルアップ効果も\r\nバランスのとれたヘルシーな着こなしが可能です\r\n1枚で肌見せするのはもちろん、インナーを合わせたレイヤードスタイルもおすすめ', 4),
(1752, 'M-Cherry', 46200, 11, '2024-02-22 16:44:00', 0, 0, '高品質のビスコースシェニール糸をブレンドしたスリーブレストップ\r\nデコルテ部分にオーバルDのメタルプラークを取り入れ、スタイリッシュなワンポイントにしました\r\nビスコース混のため、毛並みになめらかさや光沢があり、見た目はもちろん着心地も◎\r\nややクロップドレングスのレギュラーフィットなので、合わせるインナーによってさまざまなアレンジを楽しめます', 4);
